webpackJsonp([129],{"./node_modules/json-loader/index.js!./.cache/json/articles-ruby-ruby-numbers-methods.json":function(n,e){n.exports={data:{markdownRemark:{html:'<p>In Ruby there are a variety of build in methods you can perform on numbers.</p>\n<h2>Even:</h2>\n<ul>\n<li>\n<p>Use <code>.even?</code> to check whether or not an integer is even.</p>\n<p>15.even?\n4.even?</p>\n<h1>returns:</h1>\n<p>false\ntrue</p>\n</li>\n</ul>\n<h2>Odd:</h2>\n<ul>\n<li>\n<p>Use <code>.odd?</code> to check whether or not an integer is odd.</p>\n<p>15.odd?\n4.odd?</p>\n<h1>returns:</h1>\n<p>true\nfalse</p>\n</li>\n</ul>\n<h2>Ceil:</h2>\n<ul>\n<li>\n<p>The <code>.ceil</code> method rounds up to the nearest integers.</p>\n<p>8.3.ceil\n6.7.ceil</p>\n<h1>returns:</h1>\n<p>9\n7</p>\n</li>\n</ul>\n<h2>Floor:</h2>\n<ul>\n<li>\n<p>The <code>.floor</code> method rounds down to the nearest integers.</p>\n<p>8.3.floor\n6.7.floor</p>\n<h1>returns:</h1>\n<p>8\n6</p>\n</li>\n</ul>\n<h2>Next:</h2>\n<ul>\n<li>\n<p>Use <code>.next</code> to return the next consecutive integer.</p>\n<p>15.next\n2.next\n-4.next</p>\n<h1>returns:</h1>\n<p>16\n3\n-3</p>\n</li>\n</ul>\n<h2>To String:</h2>\n<ul>\n<li>\n<p>The <code>.to_s</code> method changes an integer into a string.</p>\n<p>15.to_s</p>\n<h1>returns:</h1>\n<p>"15"</p>\n</li>\n</ul>\n<h2>Greatest Common Denominator:</h2>\n<ul>\n<li>\n<p>The <code>.gcd</code> method returns the greatest common denominator of two numbers.</p>\n<p>15.gcd(5)\n9.gcd(4)</p>\n<h1>returns:</h1>\n<p>5\n1</p>\n</li>\n</ul>',frontmatter:{title:"Ruby Numbers Methods",parent:"/home/stuart/guides/src/pages/articles/ruby/ruby-numbers-methods/index.md absPath of file"}}},pathContext:{slug:"/articles/ruby/ruby-numbers-methods/"}}}});
